import React from "react";
import { useState } from "react";
import { useEffect } from "react";
import {
    Button,
    Row,
    Table,
    Col,
    Modal,
    ModalHeader,
    
} from 'reactstrap'

const Dashboard = () => {
    const [employeeList, setEmployeeList] = useState([]);

    useEffect(() => {
        const dataDummy = [
            {
                "name": "John",
                "age": 25
            },
            {
                "name": "Doe",
                "age": 26
            }
        ]

        setEmployeeList(dataDummy); // Test munculin di console browser [Inspect element]
    }, [])

    console.table(employeeList)
    return (
        <div>
            Dashboard
        </div>
    )
}

export default Dashboard;
